#!/usr/bin/env python

INSTRUCTIONS = ",\
,\
,\
,\
"
KEYPAD = [[1, 2, 3], [4, 5, 6], [7, 8, 9]]

moves = INSTRUCTIONS.split(",")
row = 1
col = 1
code = ""
for i in range(len(moves)):
    for j in range(len(moves[i])):
        if moves[i][j] == "U":
            row -= 1
        elif moves[i][j] == "D":
            row += 1
        elif moves[i][j] == "R":
            col += 1
        else:
            col -= 1
        if row == 3:
            row = 2
        if row == -1:
            row = 0
        if col == 3:
            col = 2
        if col == -1:
            col = 0
    code = code + str(KEYPAD[row][col])
print(code)
